                              <TableCell align="center">
                                {row?.translator}
                              </TableCell>
                              <TableCell align="center">
                                {row?.orderPrice}
                              </TableCell>
                              <TableCell align="center">
                                {row?.orderedDate}
                              </TableCell>
                              {row?.status === "Succeed" ? (
                                <TableCell
                                  align="center"
                                  style={{ color: "#46BC52" }}
                                >
                                  {row?.status}
                                </TableCell>
                              ) : row?.status === "Cancle" ? (
                                <TableCell
                                  align="center"
                                  style={{ color: "#CF0202" }}
                                >
                                  {row?.status}
                                </TableCell>
                              ) : (
                                <TableCell align="center">
                                  {row?.status}
                                </TableCell>
                              )}
                            </TableRow>
                          ))}
                        </TableBody>
                      </Table>
                    </TableContainer>
                  </div>
                </>
              ) : null}
            </div>
          </>
        )}
      </Box>
    </div>
  );
}
